import React from "react";
import { TETROMINOS } from "../tetrominos";

const Cell = (props) => (
  <div
    type={props.type}
    style={{
      backgroundColor: `${TETROMINOS[props.type].color}`,
      boxSizing: "border-box",
      border: `${
        TETROMINOS[props.type].shape === 0 ? "0px" : "1px solid #fff"
      }`,
      padding: "10px",
    }}
  ></div>
);

export default Cell;
